import { Button, Form, Input, Radio } from "antd";

const Signup = () => {
  return (
    <div className="signup_wrapper">
      <Form
        name="basic"
        labelCol={{
          span: 8,
        }}
        wrapperCol={{
          span: 16,
        }}
        style={{
          maxWidth: 600,
          border: "1px solid #80808069",
          margin: "auto",
          padding: "40px",
          backgroundColor: "azure",
        }}
      >
        <Form.Item
          label="First Name"
          name="firstname"
          rules={[
            {
              required: true,
              message: "please enter your first name",
            },
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label="last Name"
          name="lastname"
          rules={[
            {
              required: true,
              message: "please enter your last name",
            },
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item label="Radio">
          <Radio.Group>
            <Radio value="male"> Male </Radio>
            <Radio value="female"> Female </Radio>
            <Radio value="othe"> Other </Radio>
          </Radio.Group>
        </Form.Item>

        <Form.Item
          label="Password"
          name="password"
          rules={[
            {
              required: true,
              message: "Please input your password!",
            },
          ]}
        >
          <Input.Password />
        </Form.Item>

        <Form.Item
         wrapperCol={{
            offset: 8,
            span: 16,
          }}
        >
          <Button
             type="primary"
             htmlType="submit"
            >
            SignUp
          </Button>
          <Button 
            htmlType="button"
          >
            Reset
          </Button>
        </Form.Item>
      </Form>
    </div>
  );
};

export default Signup;
